const DiaryEditor = () => {
  const [author, setAuthor] = useState('');

  return (
    <div className="DiaryEditor">
      <h2>Today I Learned</h2>
      <div>
        <input
          value={author}
          onChange={(e) => {
            setAuthor(e.target.value);
          }}
        />
      </div>
      <div>
        <textarea name="" id="" cols="30" rows="10"></textarea>
      </div>
    </div>
  );
};

export default DiaryEditor;
